import { images } from '../constants'

const ArticleCard = () => {
  return (
    <div className='rounded-xl overflow:hidden shadow box-shadow: 0 4px 6px -1px rgb(0 0 0 / 0.1), 0 2px 4px -2px rgb(0 0 0 / 0.1);'>
        <img src={images.PostImage} alt="" />
    </div>
  )
}

export default ArticleCard
